validateUpdateContentBlock?: [{	by: ValueTypes["ContentBlockUniqueWhere"] | Variable<any, string>,	data: ValueTypes["ContentBlockUpdateInput"] | Variable<any, string>},ValueTypes["_ValidationResult"]],
